import React from "react";
import BorderSpecimen from "./border-specimen";

const BorderPage = () => (
  <div className="border-page">
    <h2>Borders</h2>
    <h3>100</h3>
    <div className="border-page-grid">
      <BorderSpecimen name="border-100" />
      <div className="border-specimen-in-dark">
        <BorderSpecimen name="border-100-inverse" />
      </div>
    </div>

    <h3>Thick</h3>
    <div className="border-page-grid">
      <BorderSpecimen name="border-thick" />
      <div className="border-specimen-on-dark">
        <BorderSpecimen name="border-thick-inverse" />
      </div>
    </div>
  </div>
);

export default BorderPage;

